import * as React from "react";
import Slider from "@mui/material/Slider";
import Box from "@mui/material/Box";


export default function StyledComponentsDeep() {
  return (
    <Box sx={{ width: 300 }}>
      <Slider defaultValue={30} />
      <CustomizedSlider defaultValue={30} />
    </Box>
  );
}
